import React from 'react'
import image from './Logos/1.png'
import styled from 'styled-components'
const Toolbar = styled.header`
/* .card-img-overlay{
    background-color:#F56753;
    opacity:0.6
}
.card-img{
    max-height:481px;
    opacity:1
}
.card-ti{
    max-width:550px;
    margin:3%;
    //styleName: Heading 1;
font-family: Poppins;

font-style: normal;
font-weight: 700;
letter-spacing: -0.015em;
text-align: left;


} */
h1{
    color:white;
    margin:0;
}
.op{
    background-color:#F56753;
    width:100%;
    position: absolute;
    
}
.img1{
   position: absolute;
   top:50%;
   left:15%;
   --webkit-transform:translateY(-50%);
   --ms-transform:translateY(-50%);
   z-index:2;
   font-family:noto serif;
}
.main{
    background-color:#F56753;
   
    
}
.fluid-container{
    height:462px;
    background-image:url(${image});
    background-repeat:no-repeat;
    background-size:100%;
    background-position:center;
    position: relative;
    width:100% 
}

`
function FooterTop() {
    return (
        <>
            <Toolbar>
                <div className="fluid-container">
                    <div className="img1">
                        <h1 className="card-ti" ><strong>2021 AAZADY CAMPERVAN EVENT</strong></h1>
                    </div>
                    <div className="op">

                    </div>
                </div>
                {/* <div className="card text-white"  >

                    <img src={image} className="card-img" alt="car" />


                    <div className="card-img-overlay" >
                        <h1 className="card-ti" >2021 AAZADY CAMPERVAN EVENT</h1>
                    </div>
                </div> */}
            </Toolbar>

        </>
    )
}

export default FooterTop
